    _totalBill = totalBill;
    _totalCollection = totalCollection;
    _balance = balance;
}

  CustomerReceivableModel.fromJson(dynamic json) {
    if (json['detail'] != null) {
      _detail = [];
      json['detail'].forEach((v) {
        _detail?.add(Detail.fromJson(v));
      });
    }
    _totalBill = json['Total Bill'];
    _totalCollection = json['Total Collection'];
    _balance = json['Balance'];
  }
