  num? totalCollection,
  num? balance,
}) => CustomerReceivableModel(  detail: detail ?? _detail,
  totalBill: totalBill ?? _totalBill,
  totalCollection: totalCollection ?? _totalCollection,
  balance: balance ?? _balance,
);
